import "./ExpensesDate.css";

function ExpensesDate(props) {
  return (
    <ul className="date">
      <li className="date-month"></li>
      <li className="date-day"></li>
      <li className="date-year"></li>
    </ul>
  );
}

export default ExpensesDate;
